import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faYoutube,
  faFacebook,
  faTwitter,
  faInstagram
} from "@fortawesome/free-brands-svg-icons";


export default function SocialBar(){
  return(
    <div className = "socialContainer text-center">
      <a href = "https://www.youtube.com/channel/UCSO0_aUhJ-nIfZtXJoWAQgg" className = "youTube px-3">
        <img src = "./Fonts/Icons/iconfinder_youtube-social-network-brand-logo_1820429.png"/>
      </a>
      <a href = "https://twitter.com/ftw_jordon" className = "twitter px-3">
        <FontAwesomeIcon icon={faTwitter} size="2x" />
      </a>
      <a href = "https://www.instagram.com/jordonramsay/" className = "instagram px-3">
        <FontAwesomeIcon icon={faInstagram} size="2x" />
      </a>
    </div>
  )
}
